export type IconName = RegularIconName | SolidIconName;

export type IconType = 'regular' | 'solid';

// Helper type to get the appropriate icon name type based on icon type
export type IconNameForType<T extends IconType> =
  T extends 'regular' ? RegularIconName :
  T extends 'solid' ? SolidIconName :
  never;

// Utility type for type-safe icon selection
export interface IconSelection<T extends IconType = IconType> {
  name: IconNameForType<T>;
  type: T;
}
